n, k = map(int, input().split())
a = list(map(int, input().split()))
b = list(map(int, input().split()))

a = [(i - 1) // 2 for i in a]
b = [(j - 1) // 2 for j in b]

done = [False] * n
num = 0
for i in a:
	if done[i]:
		continue
	num += 1
	done[i] = True

num_done = 0
for i in b:
	if num_done < i:
		num_done += 1

if num!= k and num_done == len(b):
	print("Yes")
else:
	print("No")
